    YOW += y[28]*imw[28]; /*A-C3H4 */
    YOW += y[29]*imw[29]; /*A1 */
    YOW += y[30]*imw[30]; /*A1- */
    YOW += y[31]*imw[31]; /*C5H5 */
    YOW += y[32]*imw[32]; /*C3H6 */
    YOW += y[33]*imw[33]; /*C4H8 */
    YOW += y[34]*imw[34]; /*C5H6 */
    YOW += y[35]*imw[35]; /*A2 */
    YOW += y[36]*imw[36]; /*C5H10 */
    YOW += y[37]*imw[37]; /*C5H11 */
    YOW += y[38]*imw[38]; /*A1C2H2 */
    YOW += y[39]*imw[39]; /*A1CH2 */
    YOW += y[40]*imw[40]; /*A1CHO */
    YOW += y[41]*imw[41]; /*A1CH3 */
    YOW += y[42]*imw[42]; /*C7H15 */
    YOW += y[43]*imw[43]; /*N-C7H16 */
