    YOW += y[25]*imw[25]; /*N-C3H7 */
    YOW += y[26]*imw[26]; /*C2H6 */
    YOW += y[27]*imw[27]; /*P-C3H4 */
    YOW += y[28]*imw[28]; /*A-C3H4 */
    YOW += y[29]*imw[29]; /*A1 */
    YOW += y[30]*imw[30]; /*A1- */
    YOW += y[31]*imw[31]; /*C5H5 */
